import React, { useState, useEffect } from "react";
import axios from "axios";

function Tagresult(props){
    const [data, setData] = useState([]);
    const [selectedSongs, setSelectedSongs] = useState(new Set()); // 선택된 아이템 집합
    const [filteredData, setFilteredData] = useState([]); // 초기에 랜덤으로 20개의 아이템 선택        

    const getResult = async() => {
        try {
            const response = await axios.get('http://localhost:8080/api/newsong');
            setData(response.data);
            console.log(response);
        } catch (e) {
            console.log(e);
        }
    };

    useEffect(() => {
        getResult();
      }, []);


  
    return (
      
        <div className="cent" style={{ margin: "20px", width: "100%" }}>
        <div style={{ display: "flex", justifyContent: "center" }}>
          <table className="cent">
            <tbody>
              <tr>
                <td colSpan="4" style={{ textAlign: "left" }}>
                  <p>당신이 좋아할만한 노래</p>
                </td>
              </tr>
              <tr style={{ fontSize : '16px', textAlign: 'left' }}>
              <td className="td400">
                <div style={{display : 'flex', flexDirection: 'row'}} >
                <img onClick={() => {handleSongClick(filteredData[0]?.songName); handleIdClick(filteredData[0]?.id);} }  alt = "song" src={filteredData[0]?.url} width="50" height="50"/>                         
                <div style = {{ marginLeft : '10px' }}>
                  <span onClick={() => {handleSongClick(filteredData[0]?.songName); handleIdClick(filteredData[0]?.id);}}>
                    {filteredData[0]?.songName}
                  </span>
                  <p onClick={() => {handleSongClick(filteredData[0]?.songName); handleIdClick(filteredData[0]?.id);}} style={{ fontSize: '10px', textAlign: 'left' }} >{filteredData[0]?.artistName}</p>                  
                </div>
                </div>                
              </td>
              <td className="td400">
                <div style={{display : 'flex', flexDirection: 'row'}} >
                  <img onClick={() => {handleSongClick(filteredData[1]?.songName); handleIdClick(filteredData[1]?.id);}} alt = "song" src={filteredData[1]?.url} width="50" height="50"/>                  
                  <div style = {{ marginLeft : '10px' }} >
                  <span onClick={() => {handleSongClick(filteredData[1]?.songName); handleIdClick(filteredData[1]?.id);}}>
                    {filteredData[1]?.songName}
                  </span>
                  <p onClick={() => {handleSongClick(filteredData[1]?.songName); handleIdClick(filteredData[1]?.id);}} style={{ fontSize: '10px', textAlign: 'left' }} >{filteredData[1]?.artistName}</p>
                </div>
                </div>
              </td>
              <td></td><td></td>
              </tr>
              <tr style={{ justifyContent: "center" }}>
                <td className="tdSize">
                  <img
                    src="image5.jpg"
                    alt="Image 5"
                    style={{ maxWidth: "180px", maxHeight: "180px" }}
                  />
                </td>
                <td className="tdSize">
                  <img
                    src="image6.jpg"
                    alt="Image 6"
                    style={{ maxWidth: "180px", maxHeight: "180px" }}
                  />
                </td>
                <td className="tdSize">
                  <img
                    src="image7.jpg"
                    alt="Image 7"
                    style={{ maxWidth: "180px", maxHeight: "180px" }}
                  />
                </td>
                <td className="tdSize">
                  <img
                    src="image8.jpg"
                    alt="Image 8"
                    style={{ maxWidth: "180px", maxHeight: "180px" }}
                  />
                </td>
              </tr>
            </tbody>
          </table>
        </div>
    </div>
  
      
    );
  };
  
  export default Tagresult;
